import React from "react";

const Footer = () => {
  return (
    <>
      <div className="animBorder"></div>
      <footer>
        <h2>Contact</h2>
        <div className="tel">
          <a href="tel:+33659920450">
            <img src="../assets/img/icons/tel.webp" alt="" />
          </a>
        </div>
        <div className="email">
          <a href="mailto:aurelien.corre@outlook.fr">
            <img src="../assets/img/icons/email.webp" alt="" />
          </a>
        </div>
        <div className="adress"></div>
      </footer>
      ;
    </>
  );
};

export default Footer;
